import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class FoodService {

  constructor() { }

  getAll(){
    return [
      {
        id:1,
        name:'abcd',
        cookTime: '10-20',
        price: 10,
        favorite: false,
        origins:['italy'],
        stars:4.5
      }
    ]
  }
}
